import React from "react";
const ProductsList = (props) => {
  return (
    <div class="card">
      <div class="card-border-top"></div>
      <div class="img">
        <img></img>
      </div>
      <span> Person</span>
      <p class="job"> Job Title</p>
      <button> Click</button>
    </div>
  );
};
export default ProductsList;
